  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Prime
  Hook National Wildlife Refuge outlines Refuge accomplishments during the 1967 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  raptors, fish,  reptiles, and disease- is also covered. The Refuge development and
  maintenance section discusses physical development, plantings and vegetation control.
  Resource management is outlined; topics include grazing, haying, and fur harvesting.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, violations, and safety. Items of interest, N-R forms,
  photographs, and newspaper articles are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
